import React, { Component } from "react";
import {
  ComposableMap,
  Geographies,
  Geography,
  ZoomableGroup,
} from "react-simple-maps";
import { Paper, Typography } from "@material-ui/core";

const geoUrl =
  "https://raw.githubusercontent.com/zcreativelabs/react-simple-maps/master/topojson-maps/world-110m.json";

function infoTab() {
  return (
    <div>
      <Paper>
        <Typography variant="h6">InfoChart</Typography>
      </Paper>
    </div>
  );
}

export const MapDisplay = () => (
  <div>
    <ComposableMap>
      <ZoomableGroup zoom={1}>
        <Geographies geography={geoUrl}>
          {({ geographies }) =>
            geographies.map((geo) => (
              <Geography
                key={geo.rsmKey}
                geography={geo}
                // fill="#DDD"
                // stroke="#DDD"
              />
            ))
          }
        </Geographies>
      </ZoomableGroup>
    </ComposableMap>
  </div>
);
